import "./DescriptionBox.css";

function DescriptionBox(props) {
  return (
    <div className={props.item.description_box.position, props.item.description_box.style}>
      <h1>Pancake</h1>
      <p>
        Млечно - Бело - Темно чоколадо, банана, јагода, пченично брашно, путер,
        млеко, квасец, сол, шеќер, јајца, ванилин, вода.
      </p>
      <h6>АЛЕРГЕН: Млеко, глутен, кикирики, јајца</h6>
      <h2>230den</h2>
    </div>
  );
}

export default DescriptionBox;
